import React, { Component } from 'react';

class Settings extends Component {
  render() {
    return (
      <div className="login-container">
        <form>
          <button
            className="light-font"
            data-testid="btn-play"
            type="button"
            id="play-button"
          >
            Lets Play!
          </button>
        </form>
      </div>
    );
  }
}

export default Settings;
